const INITIAL_STATE = {
  name: '',
  assertions: '',
  gravatarEmail: '',
  score: 0,
};

const playerReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
  default:
    return state;
  }
};
export default playerReducer;
